import React, { useState, useEffect } from "react";
import Navbar from "./Navbar.js";

function App() {
  const [users, setUsers] = useState([]);

  useEffect(() => {
    fetch("https://jsonplaceholder.typicode.com/users")
      .then((response) => response.json())
      .then((data) => setUsers(data));
  }, []);


  return (
    <div className="App">
      <Navbar />
      <div className="grid">
        <div className="users">
          <div>
            <img src="" />
          </div>
          <div className="details">
            <p className="id"><span>ID: </span>
              1
            </p>
            <div className="name">
              <p className="f_name"><span>First Name: </span>
                Gyan Prakash
              </p>
              <p className="l_name"><span>Last Name: </span>
                Kumar
              </p>
            </div>
            <p className="email">
              <span>E-mail: </span>
              gyanprakashk55@gmail.com
            </p>
          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
